const AWS=require("aws-sdk"),{getBucketName}=require("../util");async function getrc(){var bucketName=await getBucketName();const s3=new AWS.S3,data=await s3.getObject({Bucket:bucketName,Key:"artillerypro.rc"}).promise();return JSON.parse(Buffer.from(data.Body.toString(),"hex").toString())}module.exports=getrc;